import "./ContentList.css";
import dummy from "../resource/dummyData";
import { useState } from "react";

function ContentList() {
  const [contents, setContents] = useState(dummy);
  return (
    <div className="ContentList">
      <header>
        <div></div>
        <h2>목록</h2>
        <button className="contentList__btn">글쓰기</button>
      </header>
      <ul className="contentList">
        {contents.map((el) => {
          <li className="content" id={el.id}>
            <div className="content__name">{el.username}</div>
            <div className="content__title">{el.title}</div>
            <div className="content__createdAt">{el.creatAt}!</div>
          </li>;
        })}
      </ul>
    </div>
  );
}

export default ContentList;
